control.onControlLoad:
g5.linkId = parseInt(ee.getQueryString("linkId"));
if (isNaN(g5.linkId)) {
    alert("请从指定的位置调用本页面");
}


//鼠标点击行激活处理
g5.date = null;
g5.tableClick1 = function(sender) {
    var c, x, y; 
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 2; x++) {
            c = ee.getTableCell(ee.getControl("tablebody2"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    g5.selectedX = Math.max(1, sender.colIndex)
    for (x = 0; x < 2; x++) {
        c = ee.getTableCell(ee.getControl("tablebody2"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset1)) {
        g5.date = null;
        return;
    }
    g5.date = g5.dataset1.getData(0, sender.rowIndex);
    g5.pageCurrent2 = 1;
    query2();
}
g5.time = null;
g5.tableClick2 = function(sender) {
    var c, x, y; 
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 2; x++) {
            c = ee.getTableCell(ee.getControl("tablebody3"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    g5.selectedX = Math.max(1, sender.colIndex)
    for (x = 0; x < 2; x++) {
        c = ee.getTableCell(ee.getControl("tablebody3"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset2)) {
        g5.time = null;
        return;
    }
    g5.time = g5.dataset2.getData(0, sender.rowIndex);
    g5.pageCurrent3 = 1;
    query3();
}
g5.actionId = null;
g5.tableClick3 = function(sender) {
    var c, x, y; 
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 3; x++) {
            c = ee.getTableCell(ee.getControl("tablebody1"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    g5.selectedX = Math.max(1, sender.colIndex)
    for (x = 0; x < 3; x++) {
        c = ee.getTableCell(ee.getControl("tablebody1"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset3)) {
        g5.actionId = null;
        return;
    }
    g5.actionId = g5.dataset3.getData(0, sender.rowIndex);
}


//分页处理
g5.pageSize = 15;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query1();
        }
    }
}
g5.pageSize2 = 15;
g5.pageCurrent2 = 1;
g5.pageCount2 = 1;
g5.pageJump2 = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount2) {
        pageNumber = g5.pageCount2;
    }
    if (g5.pageCurrent2 != pageNumber) {
        g5.pageCurrent2 = pageNumber;
        if (g5.pageCurrent2 > 0) {
            query2();
        }
    }
}
g5.pageSize3 = 15;
g5.pageCurrent3 = 1;
g5.pageCount3 = 1;
g5.pageJump3 = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount3) {
        pageNumber = g5.pageCount3;
    }
    if (g5.pageCurrent3 != pageNumber) {
        g5.pageCurrent3 = pageNumber;
        if (g5.pageCurrent3 > 0) {
            query3();
        }
    }
}


query1();

control.onClick:
if (eb.isEmpty(g5.actionId)) {
    alert("请选择有效的记录进行播放");
    return;
}
if (eb.isEmpty(g5.url)) return;
var sh = parseInt(window.screen.height);
if (isNaN(sh)) {
    window.open(g5.url + "&actionId=" + g5.actionId);
} else {
    sh -= 50;
    var w = parseInt(sh/16*9);
    window.open(g5.url + "&actionId=" + g5.actionId, "页面播放" + g5.actionId,
        "height=" + sh + ", width=" + w + ", top=0, left=50, toolbar=no, menubar=no, scrollbars=no, resizable=no, location=no, status=no");
}

if (eb.isEmpty(g5.actionId)) {
    alert("请选择有效的记录进行播放");
    return;
}
if (eb.isEmpty(g5.url)) return;
var sh = parseInt((window.screen.height - 175) / 2);
if (isNaN(sh)) {
    window.open(g5.url + "&actionId=" + g5.actionId);
} else {
    if (eb.isEmpty(g5.lastPos)) g5.lastPos = 0;
    var w = parseInt(sh/16*9);
    var x = (g5.lastPos % 3) * (w + 27);
    var y = parseInt(g5.lastPos / 3) * (sh + 68);
    window.open(g5.url + "&actionId=" + g5.actionId, "页面播放" + g5.actionId,
        "height=" + sh + ", width=" + w + ", top=" + y + ", left=" + x + ", toolbar=no, menubar=no, scrollbars=no, resizable=no, location=no, status=no");
    g5.lastPos = (g5.lastPos + 1) % 6;
}

control.onUpdate:
var a = parseInt(text);
if (isNaN(a)) {
    ee.setText(sender, "");
    return;
}
var t = "";
if (parseInt(a/3600) > 0) {
    t += parseInt(a/3600) + "小时";
}
if ((parseInt(a/60) > 0) || (t != "")) {
    t += parseInt((a%3600)/60) + "分";
}
t += (a%60) + "秒";
ee.setText(sender, t);

taskSetItem.script2:
var token = eio.readString8();
var linkId = eio.readInt32();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取记录数量
sql =
    "SELECT count(*) as c " +
    "FROM (select dtime,count(*) as c from  " +
    "  (SELECT CONVERT(varchar(100), regDatetime, 23) as dtime  " +
    "    FROM [TCloud].[dbo].[userAction] where linkId=" + linkId + ") as t1  " +
    "  group by dtime) as t2  ";
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

//获取link的url
sql = "select * from [link] where id=" + linkId;
sqlResult = db.executeQuery("DB", sql);   
if (!db.read(sqlResult)) {
    eio.appendString8("F");
    return;
}
var url = db.getString(sqlResult, "url")

//获取数据
sql= 
    "select dtime,count(*) as c from " + 
    "  (SELECT CONVERT(varchar(100), regDatetime, 23) as dtime " +
    "    FROM [TCloud].[dbo].[userAction] where linkId=" + linkId + ") as t1 " +
    "  group by dtime " +
    "  order by dtime desc";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}

eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"dTime,c", pageSize*(pageCurrent-1), pageSize);
eio.appendString16(url)

taskSetItem.script3:
if (eio.readString8() != "T") {
    alert("无法获取您需要的数据：" + eio.readString8());
    return;
}
g5.pageRecordCount = eio.readInt32();
g5.dataset1 = eio.readDataSet();
g5.url = eio.readString16();
g5.user = eio.readString8();
g5.pageCount = parseInt((g5.pageRecordCount-1)/g5.pageSize)+1;
ee.setTableData(ee.getControl("tablebody2"), g5.dataset1,0);
ee.setAutoScroll(ee.getControl("layoutyitem2"), false);   
setTimeout(function () { ee.setAutoScroll(ee.getControl("layoutyitem2"), true)}, 100);   
ee.setText(ee.getControl("layoutxitem45"), g5.pageCurrent + "/" + g5.pageCount);
ee.setText(ee.getControl("panel16"), "共找到" +
    "<font color = '#d00000'>" + g5.pageRecordCount + "条</font>记录");

