taskSetItem.script2:
var token = eio.readString8();
var linkId = eio.readInt32();
var date = eio.readString16();
var time = eio.readString16().substring(0,2);
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取记录数量
sql =
    "SELECT count(*) as c " +
    "FROM (SELECT [id], CONVERT(varchar(100), regDatetime, 108) as dtime,[linkId],[duration],[data] " +
    "  FROM [TCloud].[dbo].[userAction] " +
    "  where linkId=" + linkId + " and LEFT(CONVERT(varchar(100), regDatetime, 120),13) = '" + db.encode(date + " " + time) + "') as t2";
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT [id], CONVERT(varchar(100), regDatetime, 108) as dtime,[linkId],[duration],[data] " +
    "  FROM [TCloud].[dbo].[userAction] " +
    "  where linkId=" + linkId + " and LEFT(CONVERT(varchar(100), regDatetime, 120),13) = '" + db.encode(date + " " + time) + "' " +
    "  order by regDatetime";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
} 
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"id,dTime,duration,data", pageSize*(pageCurrent-1), pageSize);

